Un abbraccio è il gesto d’amore più immediato e questo San Valentino può fare davvero la differenza. Condividi la foto di un abbraccio usando l’hashtag #OVSlovepeoplenotlabels 
Per ogni foto, @ovspeople donerà a @savethechildrenitalia il corrispettivo degli antibiotici necessari per curare 5 bambini dalla polmonite in Yemen. 
@savethechildrenitalia @ovspeople #ad

